" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 531px\">",
"   <div class=\"ttl\">",
"    Shoulder internal rotation in a 90 90 position",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 511px; height: 214px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Anchor the tubing at&nbsp;about head height and face away from the object to which it is anchored.&nbsp;Keep&nbsp;the involved arm in a 90-90 position throughout the exercise. Next, rotate your arm forward away from the wall&nbsp;over a two second&nbsp;count until your hand is about even with your shoulder, then slowly return back to the starting position&nbsp;over a&nbsp;four second&nbsp;count. Repeat 15 times to complete one set, then rest 30 seconds. Repeat for 3 sets of 15 repetitions.",
"    <div class=\"footnotes\">",
