"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Treatment for type 2 diabetes (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/treatment-for-type-2-diabetes-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H1667080827\">",
"      <span class=\"h1\">",
"       What are the goals of type 2 diabetes treatment?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The goals of treatment for type 2 diabetes (sometimes called type 2 &ldquo;diabetes mellitus&rdquo;) are:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        To keep a person&rsquo;s blood sugar at or near a normal level",
"       </li>",
"       <li>",
"        To prevent future health problems that can happen in people with diabetes",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1667080834\">",
"      <span class=\"h1\">",
"       How is type 2 diabetes treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Type 2 diabetes can be treated with:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Diet changes",
"       </li>",
"       <li>",
"        Lifestyle changes",
"       </li>",
"       <li>",
"        Medicines",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Your doctor or nurse will work with you to make a treatment plan that is right for you.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1667080841\">",
"      <span class=\"h1\">",
"       What diet and lifestyle changes might be part of my treatment?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Diet and lifestyle changes that might be part of your treatment include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Losing weight",
"       </li>",
"       <li>",
"        Eating healthy foods",
"       </li>",
"       <li>",
"        Getting regular exercise",
"       </li>",
"       <li>",
"        Not smoking",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1667080848\">",
"      <span class=\"h1\">",
"       What medicines are used to treat type 2 diabetes?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Different medicines can be used to treat type 2 diabetes. The first medicine that most people with type 2 diabetes take is a pill called",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?0/22/358?source=see_link\">",
"       metformin",
"      </a>",
"      (sold as Glucophage&reg;).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1667080855\">",
"      <span class=\"h1\">",
"       How do I know if my treatment is working?",
"      </span>",
"      &nbsp;&mdash;&nbsp;One way to know if your treatment is working is to check your blood sugar level. People can use a device called a &ldquo;blood glucose monitor&rdquo; to check their blood sugar level at home. If your doctor recommends that you use a blood glucose monitor, he or she will teach you how and tell you when to use it.",
"     </p>",
"     <p>",
"      Your doctor can also do a blood test called an &ldquo;A1C.&rdquo; This test checks what your blood sugar level has been over the past 2 to 3 months.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1667080862\">",
"      <span class=\"h1\">",
"       What if my blood sugar level is still higher than normal?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If your blood sugar level is still higher than normal after you have been taking",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?0/22/358?source=see_link\">",
"       metformin",
"      </a>",
"      for 2 to 3 months, your doctor might add a second medicine to your treatment.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1667080869\">",
"      <span class=\"h1\">",
"       Which second medicine will I take?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There are different medicines your doctor can prescribe. The choice will depend, in part, on your weight, your other health problems, and if you want to use a shot.",
"     </p>",
"     <p>",
"      Some of these medicines can cause low blood sugar as a side effect. Symptoms of low blood sugar can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Sweating and shaking",
"       </li>",
"       <li>",
"        Feeling hungry",
"       </li>",
"       <li>",
"        Feeling worried",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Low blood sugar should be treated quickly because it can lead to passing out. Your doctor or nurse will tell you beforehand how to treat it.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1667080876\">",
"      <span class=\"h1\">",
"       What is insulin?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Insulin is a medicine that lowers a person&rsquo;s blood sugar level. It usually comes in the form of a shot that people give themselves. People who use insulin might use it as a second medicine, or as their only medicine.",
"     </p>",
"     <p>",
"      If your doctor prescribes insulin, he or she will show you how to give yourself a shot (",
"      <a class=\"graphic graphic_figure graphicRef80789 \" href=\"UTD.htm?9/58/10145\">",
"       figure 1",
"      </a>",
"      ). He or she will also tell you:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Which type of insulin to use &ndash; Some types work faster or last longer than others.",
"       </li>",
"       <li>",
"        How much insulin to use",
"       </li>",
"       <li>",
"        When to use it",
"       </li>",
"       <li>",
"        When to check your blood sugar level",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      An insulin dose often needs to change when a person gets sick, has surgery, travels, or eats out. Ask your doctor or nurse how to change your dose during these times.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1667080883\">",
"      <span class=\"h1\">",
"       What other treatments might I need?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Sometimes, people with type 2 diabetes need medicines to treat health problems that often affect people with diabetes. For example, people who have high blood pressure might take medicines to lower their blood pressure. This can reduce their chances of having a heart attack or stroke.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1667080890\">",
"      <span class=\"h1\">",
"       When should I see my doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most people with diabetes see their doctor or nurse every 3 or 4 months. He or she will talk with you about your medicines and blood sugar levels. If your blood sugar levels are not in control, your doctor might make changes to your treatment plan.",
"     </p>",
"     <p>",
"      Taking care of diabetes can be hard, and some people feel sad or worried about their diabetes. Let your doctor or nurse know if you feel this way so that he or she can help.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1667080897\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
