var title_f15_49_16155="Diagn approach depres CA pt";
var content_f15_49_16155=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F81607&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F81607&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Approaches to the diagnosis of major depression in cancer patients",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Approach",
"       </td>",
"       <td class=\"subtitle1\">",
"        Example",
"       </td>",
"       <td class=\"subtitle1\">",
"        Description",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Inclusive",
"       </td>",
"       <td>",
"        RDC (Research Diagnostic Criteria)",
"       </td>",
"       <td>",
"        Includes somatic symptoms in diagnostic criteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Exclusive",
"       </td>",
"       <td>",
"        HADS (Hospital Anxiety and Depression Scale)",
"       </td>",
"       <td>",
"        Completely excludes somatic symptoms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Substitutive",
"       </td>",
"       <td>",
"        Endicott",
"       </td>",
"       <td>",
"        Substitutes cognitive for somatic symptomatology",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Etiologic",
"       </td>",
"       <td>",
"        -",
"       </td>",
"       <td>",
"        Determines whether particular symptom is due to medical causes before including or excluding in diagnostic criteria for depression",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Increased threshold",
"       </td>",
"       <td>",
"        -",
"       </td>",
"       <td>",
"        The increased threshold approach requires that 7, rather than 5, out of 9 DSM-IV criterion symptoms be present in order to qualify for a diagnosis of major depression",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
